        "howtoplay.adventureMode.text.1": "\u5192\u9669\u6a21\u5f0f\u662f\u4e16\u754c\u5efa\u9020\u8005\u7684\u4e00\u79cd\u6e38\u620f\u6a21\u5f0f\u3002\u5728\u5192\u9669\u6a21\u5f0f\u4e2d\uff0c\u73a9\u5bb6\u5fc5\u987b\u4f7f\u7528\u7279\u6b8a\u5de5\u5177\u6765\u653e\u7f6e\u6216\u51fb\u7834\u65b9\u5757\u3002\t",
