        "howtoplay.HUD.text.7.touch": "\u70ed\u952e\u663e\u793a\u53ef\u4f9b\u4f7f\u7528\u7684\u7269\u54c1\u3002\u70b9\u51fb\u70ed\u952e\u4e2d\u7684\u7269\u54c1\u5373\u53ef\u66f4\u6539\u60a8\u624b\u4e2d\u7684\u7269\u54c1\u3002\t",
