        "howtoplay.inventory.text.2": "\u6b64\u5c4f\u5e55\u663e\u793a\u4f60\u624b\u6301\u7684\u6240\u6709\u7269\u54c1\u4ee5\u53ca\u4f60\u643a\u5e26\u7684\u6240\u6709\u5176\u4ed6\u7269\u54c1\u3002\u4f60\u8fd8\u53ef\u4ee5\u67e5\u770b\u81ea\u5df1\u7a7f\u7740\u7684\u76d4\u7532\u3002\t",
        "howtoplay.inventory.text.3.keyboard": "\u7528 :mouse_left_button: \u62fe\u8d77\u5149\u6807\u4e0b\u7684\u7269\u54c1\u3002\u5982\u679c\u5149\u6807\u4e0b\u6709\u4e00\u4e2a\u4ee5\u4e0a\u7269\u54c1\uff0c\u8be5\u52a8\u4f5c\u4f1a\u62fe\u8d77\u6240\u6709\u7269\u54c1\uff0c\u60a8\u4e5f\u53ef\u4ee5\u7528 :mouse_right_button: \u62fe\u8d77\u5176\u4e2d\u4e00\u534a\u7684\u7269\u54c1\u3002\t",
