        "tips.edu.5": "\u8981\u8ba9\u540c\u4f34\u8fde\u63a5\u5230\u60a8\u7684\u4e16\u754c\uff0c\u8bf7\u6682\u505c\u6e38\u620f\u5e76\u5206\u4eab\u60a8\u7684\u52a0\u5165\u4ee3\u7801\u3002\t",
