        "tips.edu.7": "\u5df2\u5b8c\u6210\u60a8\u7684\u521b\u4f5c\uff1f\u8ba9\u522b\u4eba\u4f5c\u4e3a\u8bbf\u5ba2\u6e38\u89c8\u60a8\u7684\u4e16\u754c\u4ee5\u4fbf\u4fdd\u62a4\u60a8\u7684\u4f5c\u54c1\u3002\t",
        "tips.edu.8": "\u8981\u5728 Minecraft \u4e2d\u7f16\u8f91\u4ee3\u7801\uff0c\u8bf7\u6309\u4e0b\u952e\u76d8\u4e0a\u7684\u201cC\u201d\u952e\u6216\u89e6\u6478\u5c4f\u5e55\u9876\u90e8\u7684\u4ee3\u7406\u673a\u5668\u4eba\u56fe\u6807\u3002\t",
        "tips.edu.9": "\u7528\u8fd9\u4e2a\u5e93\u6765\u5bfb\u627e\u53ef\u4f9b\u521b\u5efa\u7684\u65b0\u7684\u6e38\u620f\u4e16\u754c\u3002\t",
        "tips.edu.10": "\u6b63\u5728\u5bfb\u627e\u7279\u5b9a\u7684\u751f\u7269\u7fa4\u7cfb\uff1f\u8bd5\u8bd5\u5e93\u5427\u3002\t",
