        "tips.edu.20": "\u5728\u521b\u5efa\u4e16\u754c\u65f6\u9009\u62e9\u4e00\u4e2a\u201c\u9ed8\u8ba4\u8bfe\u7a0b\u6a21\u5f0f\u201d\u6765\u6307\u5b9a\u60a8\u60f3\u8981\u7684\u63a2\u7d22\u65b9\u6cd5\u3002\t",
